  const [location, setLocation] = useState(Data);
  return (
    <div>
         <Link to={`/location/${location.id}`}> new location</Link>
      <h1>Location just one</h1>
      {location.map((location) => {
        return (
          <div>
            {" "}
            key={location.id}
            <h4>{location.title}</h4>

          </div>
        );
      })}
    </div>
  );
};

export default Location;
